import { RECEIVE_API_DATA, RECEIVE_API_POST_DATA } from "../actions";

export default (state = {}, { type, data, query }) => {
  switch (type) {
    case RECEIVE_API_DATA:
      console.log('NUM', query)
      return {
          posts: data
      }
      case RECEIVE_API_POST_DATA:
        return {
            posts: data
        }
    default:
      return state;
  }
};
